import React from 'react';

const VerbalQuestions = () => {
  return (
    <div className="p-4">
      <h1 className="text-2xl font-bold mb-4">Verbal Ability</h1>
      <div>
        <h2 className="text-xl font-semibold">Question 1</h2>
        <p>Complete the analogy: Book is to Reading as Fork is to ?</p>
        <p className="mt-2 font-bold">Answer:</p>
        <p>Eating.</p>
      </div>
      <div className="mt-4">
        <h2 className="text-xl font-semibold">Question 2</h2>
        <p>What is the synonym of "Abundant"?</p>
        <p className="mt-2 font-bold">Answer:</p>
        <p>Plentiful.</p>
      </div>
      {/* Add more questions and answers as needed */}
    </div>
  );
};

export default VerbalQuestions;
